import './field.css'

interface FieldProps {
  labelValue: string;
  inputType: string;
}

const Field = ({ labelValue, inputType }: FieldProps) => {
  return (
    <div className="field-container">
      <label>{labelValue + ": "}</label>
      <input type={inputType} name={labelValue.toLowerCase()} 
      placeholder={"Enter " + labelValue.toLowerCase()} required/>

    </div>
  );
}

export default Field;
